import React from 'react';
import './Header.css';
import logo from "../../img/menu.png";

function Header() {
  return (
    <header className="header">
        <div className="header__logo-box"> 
          <img src={logo} className="header__logo" alt="logo" />
        </div>
    </header>
  );
}

export default Header;
